import React from 'react';
import logo from './logo.svg';
import './App.css';

function iBox(props){
  return (
    <form>
    <label for="box">{props.name}</label>
    <input type="text" id="box"> </input>
    </form>
  );
}


function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
      <iBox name="This is an input"></iBox>
    </div>
  );
}

export default App;
